import { useState, useEffect } from 'react';
import './Element.css';

function Element({season, revenue, price}) {

    return (
        <div className="box">
            <div className="line">{season}</div>
            <div className="line">----------</div>
            <div className="line">{revenue}</div>
            <div className="line">{price}</div>
        </div>
    );
}
export default Element;
